Usa un Japa Mala y mejorará tu concentración al meditar usando mantras. Cómo las frases “Puedo elegir o puedo  dominar mis pensamientos.

Para concentrarte en la frase anterior necesitas silencio y ser consciente de cada palabra que recitas y se usa para rezar en voz baja o interiormente,

Piensa en qué área de tu vida quieres cambiar, ya sea algo que necesitas transformar en bueno, o algo positivo que quieres mejorar. Una vez que hayas elegido, imagina cómo condensarlo en unas pocas palabras. Es importante que lo hagas bien porque el interés que pongas en ello repercute en el impacto emocional de las frases.

Japa Mala se pronuncia “yapa mala”, como todas las jotas del sánscrito, que significa guirnalda.

Cómo usar un Japa Mala
Una vez que hayas preparado todo lo que necesitas para empezar a meditar (si no sabes qué exactamente, puedes ver cuáles son los consejos del Dalai Lama), estés tranquila/o en una habitación en silencio, te hayas situado en una posición que te resulte fácil mantener, etc., es momento de usar el Japa Mala.

